import { ADD_LIST, CHANGE_LIST_NUM, CHANGE_BOOL } from './action-type'
import store from '../store/store'
export default {
    addList(params) {
        // let action = {
        //     type: ADD_LIST,
        //     params: params
        // }
        // return action
        return (dispatch) => {
            let action = {
                type: ADD_LIST,
                params: params
            }
            return action
        }
    },
    changeNum(params) {
        return (dispatch) => {
            let action = {
                type: CHANGE_LIST_NUM,
                params: params
            }
            return action
        }
    },
    changebool(params) {
        return {
            type: CHANGE_BOOL,
            params: params
        }
    }
}
